import{_ as e,c as o,o as t,a1 as a}from"./chunks/framework.9YHhhtCJ.js";const p=JSON.parse('{"title":"Overview","description":"","frontmatter":{},"headers":[],"relativePath":"Resources/SketchFab/sketchfab.md","filePath":"Resources/SketchFab/sketchfab.md"}'),l={name:"Resources/SketchFab/sketchfab.md"},i=a('<h1 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h1><p>Welcome to the Swarthmore College Sketchfab account! This platform hosts a collection of 3D models created and curated by the Swarthmore College community. Sketchfab is a powerful tool that allows users to view, interact with, and download 3D models directly from their web browser.</p><h2 id="accessing-the-sketchfab-account" tabindex="-1">Accessing the Sketchfab Account <a class="header-anchor" href="#accessing-the-sketchfab-account" aria-label="Permalink to &quot;Accessing the Sketchfab Account&quot;">​</a></h2><p>You can access the Swarthmore College Sketchfab account by visiting the following link: <a href="https://sketchfab.com/swarthmoreDS" target="_blank" rel="noreferrer">Swarthmore College Sketchfab</a>.</p><h2 id="viewing-3d-models" tabindex="-1">Viewing 3D Models <a class="header-anchor" href="#viewing-3d-models" aria-label="Permalink to &quot;Viewing 3D Models&quot;">​</a></h2><h3 id="steps-to-view-models" tabindex="-1">Steps to View Models: <a class="header-anchor" href="#steps-to-view-models" aria-label="Permalink to &quot;Steps to View Models:&quot;">​</a></h3><ol><li><p><strong>Visit the Sketchfab Page</strong>:</p><ul><li>Go to <a href="https://sketchfab.com/swarthmoreDS" target="_blank" rel="noreferrer">Swarthmore College Sketchfab</a>.</li></ul></li><li><p><strong>Browse the Collection</strong>:</p><ul><li>Scroll through the available 3D models. Each model is represented by a thumbnail image and a title.</li></ul></li><li><p><strong>Select a Model</strong>:</p><ul><li>Click on the thumbnail of the model you wish to view. This will open the model in the Sketchfab 3D viewer.</li></ul></li><li><p><strong>Interact with the Model</strong>:</p><ul><li>Use your mouse or touchpad to rotate, zoom, and pan around the model. The toolbar at the bottom of the viewer provides additional options such as switching between different views and enabling VR mode for a more immersive experience.</li></ul></li></ol><h2 id="downloading-3d-models" tabindex="-1">Downloading 3D Models <a class="header-anchor" href="#downloading-3d-models" aria-label="Permalink to &quot;Downloading 3D Models&quot;">​</a></h2><p>Some models on the Swarthmore College Sketchfab account are available for download. Follow these steps to download a model:</p><ol><li><p><strong>Select a Downloadable Model</strong>:</p><ul><li>Look for models with a download icon. Not all models are available for download due to licensing and usage restrictions.</li></ul></li><li><p><strong>Click on the Model</strong>:</p><ul><li>Open the model in the 3D viewer by clicking on its thumbnail.</li></ul></li><li><p><strong>Download the Model</strong>:</p><ul><li>If the model is available for download, you will see a &quot;Download&quot; button below the 3D viewer. Click this button to access the download options.</li></ul></li><li><p><strong>Choose the Format</strong>:</p><ul><li>Select the preferred file format for the download (e.g., .OBJ, .STL, .FBX).</li></ul></li><li><p><strong>Download the File</strong>:</p><ul><li>Click the &quot;Download&quot; button next to your chosen format. The file will be downloaded to your computer.</li></ul></li></ol><h2 id="additional-features" tabindex="-1">Additional Features <a class="header-anchor" href="#additional-features" aria-label="Permalink to &quot;Additional Features&quot;">​</a></h2><ul><li><strong>Annotations</strong>: Some models include annotations that provide additional information about specific parts of the model. Click on the annotation icons to view these details.</li><li><strong>Sharing</strong>: You can share models via social media or embed them in websites using the sharing options provided by Sketchfab.</li><li><strong>VR Mode</strong>: For an immersive experience, use the VR mode available in the Sketchfab viewer. This requires a VR headset and compatible browser.</li></ul><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><p>If you encounter any issues while using the Swarthmore College Sketchfab account, please refer to the Sketchfab Help Center or contact the account administrator for assistance.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>For any concerns or questions, please reach out to <a href="mailto:liblab@swarthmore.edu" target="_blank" rel="noreferrer">liblab@swarthmore.edu</a>.</p></div><h2 id="conclusion" tabindex="-1">Conclusion <a class="header-anchor" href="#conclusion" aria-label="Permalink to &quot;Conclusion&quot;">​</a></h2><p>The Swarthmore College Sketchfab account is a valuable resource for exploring and downloading 3D models. Whether you&#39;re a student, faculty member, or enthusiast, we hope you find these models useful and inspiring. Happy exploring!</p><hr><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Feel free to contribute and share your own 3D models to enrich our collection!</p></div>',19),r=[i];function n(s,h,c,d,u,m){return t(),o("div",null,r)}const f=e(l,[["render",n]]);export{p as __pageData,f as default};
